package com.ubl.tesis.test;

import org.springframework.boot.autoconfigure.SpringBootApplication;

import java.util.HashMap;
import java.util.Map;

/**
 * @AUTHOR RR
 * @DATE 17/12/2024
 */

public class ChiSquareTest {

    public static double hitungChiSquare(String ciphertext) {
        Map<Character, Integer> observedFrequencies = new HashMap<>();
        int textLength = ciphertext.length();

        // Hitung frekuensi karakter dalam ciphertext
        for (char c : ciphertext.toCharArray()) {
            observedFrequencies.put(c, observedFrequencies.getOrDefault(c, 0) + 1);
        }

        double expectedFrequency = (double) textLength / observedFrequencies.size();
        double chiSquare = 0.0;

        for (Map.Entry<Character, Integer> entry : observedFrequencies.entrySet()) {
            double observed = entry.getValue(); // O
            chiSquare += Math.pow(observed - expectedFrequency, 2) / expectedFrequency; // (O - E)^2 / E
        }

        return chiSquare;
    }


    public static void main(String[] args) {
        // Array ciphertext
        String[] ciphertexts = {
                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                "",

                "",
                "",
                ""
        };

        // Loop untuk setiap ciphertext
        for (int i = 0; i < ciphertexts.length; i++) {
            String ciphertext = ciphertexts[i];
            System.out.println("Ciphertext HYBRID ke " + (i + 1) + ":");

            // Analisis chi-square
            double chiSquare = hitungChiSquare(ciphertext);
            System.out.println("Chi-Square Value: " + chiSquare);

            System.out.println("-----------------------");
        }
    }

}
